<?php
/* Add Custom Admin Menu */
add_action( 'admin_menu', 'dojo_admin_create_options_menu' );

function dojo_admin_create_options_menu() {
    add_menu_page(
        'Dojo Options',
        'DOJO',
        'manage_options',
        BENYON_DOJO_MENU_SLUG,
        'dojo_admin_generate_options_view',
        'data:image/svg+xml;base64,',
        '1'
        );
}

function dojo_admin_generate_options_view() {
    if ( !current_user_can( 'manage_options' ) )  {
        wp_die( 'You do not have sufficient permissions to access this page.' );
    }

    include BENYON_DOJO_ADMIN_VIEWS . '/admin_view.php';
}

